import ReactDOM from "react-dom";
const name = "Manish Shrestha";
ReactDOM.render(
    <>
        <h1 contentEditable="true">My name is {name}</h1>
        <img src="https://picsum.photoss/200/300" alt="random picture"/>
    </>,
    document.getElementById("root")

);
